import calendaricon from "../images/calendar_icon.png";

function SearchFilter() {

    handleInputChange(event)

    return(
        <div className="SearchFilter">
            <img src={calendaricon}/>
            <label>Destination<br></br> <input type="text" name="destination" value={this.state.destination} onChange={this.handleInputChange}/></label>
            <label>Check in<br></br> <input type="date" name="checkIn" value={this.state.checkIn} onChange={this.handleInputChange}/></label>
            <label>Check out<br></br> <input type="date" name="checkOut" value={this.state.checkOut} onChange={this.handleInputChange}/></label>
            <label>Guests<br></br> <input type="number" name="guests" value={this.state.guests} onChange={this.handleInputChange}/></label>
            <label>Check availability<br></br> <button name="check">Check</button></label>
        </div>
    )
}

export default SearchFilter;
